import React from 'react';
import NavigationBar from "./components/NavigationBar";
import ContentContainer from "./components/ContentContainer";
import "./App.css";



class ContractManager extends React.Component {


constructor(props)  {
    super(props);
    this.state = { apiResponse: "" };
}

callAPI() {
    fetch("http://localhost:9000/testAPI")
        .then(res => res.text())
        .then(res => this.setState({ apiResponse: res }));
}

componentWillMount() {
    this.callAPI();
}

  render () {
    return (
    <div className="App">
      <div className="NavigationBar"><NavigationBar /></div>
        <div>
          <div className="ContentContainer"><ContentContainer title="Home"/></div>
          <p className="App-intro">Klappt{this.state.apiResponse}</p>
        </div>
    </div>
    );
  }
}

export default ContractManager;
